import React from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Header from './components/header/Header';
import MoreAbout from './components/more-about/more-about';
import Plp from './components/plp/plp';
import Homepage from './components/homepage/Homepage';
import './App.scss';
import { Footer,SubFooter } from './components/footer/Footer';
import { Wrapper }from './App-styled.js'
import labels from './components/helper/labels.json';
import MyLabels from './components/helper/labels-const.js';
import Contact from './components/contact/contact.js';
import Converter from './components/converter/CurrencyConverter.js'


const App = () => {
  console.log(MyLabels.loadingMessage);

  return (
    <BrowserRouter>
      <Header />

      <Wrapper className="App">
        <Routes>
          <Route index element={<Homepage loadingMessage={labels.loadingMessage} errorMessage={labels.errorMessage}/>} />
          <Route path='/more-about' element={<MoreAbout subTitle={labels.subTitle} />} />
          <Route path='/plp' element={<Plp loadingMessage={labels.loadingMessage} errorMessage={labels.errorMessage}/>} />
          <Route path='/contact' element={<Contact />} />
          <Route path='/converter' element={<Converter loadingMessage={labels.loadingMessage} errorMessage={labels.errorMessage}/>} />
        </Routes>
      </Wrapper>

      <div className="footerSection">
        <Footer/>
        <SubFooter/>
      </div>
    </BrowserRouter>
  );
}

export default App;
